import React, { useState, useRef } from 'react';
import './controlcentre.css';
import airdrop from './icon/Untitled_Artwork.png';
import focus from './icon/moonk.png';
import bluetooth from './icon/Untitled_Artwork 2.png';
import stage from './icon/stage.png';
import screen from './icon/screen.png';

export default function Controlcentre() {
  const [bw, setBw] = useState('rgb(111, 111, 111)');
  const [bb, setBb] = useState('rgb(111, 111, 111)');
  const [ba, setBa] = useState('rgb(111, 111, 111)');
  const [bf, setBf] = useState('rgb(111, 111, 111)');
  const [showIconW, setShowIconW] = useState(false);
  const [showIconB, setShowIconB] = useState(false);
  const [showIconA, setShowIconA] = useState(false);
  const [showIconF, setShowIconF] = useState(false);

  const brightRef = useRef(null);
  const volRef = useRef(null);

  const handleBrightnessChange = () => {
    const x = brightRef.current.value;
    const color1 = `linear-gradient(90deg, rgb(242,242,242) ${x}%, rgb(91, 75, 94) ${x}%)`;
    brightRef.current.style.background = color1;
    brightRef.current.style.filter.brightness=x;
    setBw(color1);
  };

  const handleVolumeChange = () => {
    const y = volRef.current.value;
    const color2 = `linear-gradient(90deg, rgb(242,242,242) ${y}%, rgb(91, 75, 94) ${y}%)`;
    volRef.current.style.background = color2;
    setBb(color2);
  };

  function click() {
    setBw(prevBw => prevBw === 'rgb(111, 111, 111)' ? 'rgb(191, 0, 234)' : 'rgb(111, 111, 111)');
  }

  function click2() {
    setBb(prevBb => prevBb === 'rgb(111, 111, 111)' ? 'rgb(191, 0, 234)' : 'rgb(111, 111, 111)');
  }

  function click3() {
    setBa(prevBa => prevBa === 'rgb(111, 111, 111)' ? 'rgb(191, 0, 234)' : 'rgb(111, 111, 111)');
  }

  function click4() {
    setBf(prevBf => prevBf === 'rgb(111, 111, 111)' ? 'rgb(191, 0, 234)' : 'rgb(111, 111, 111)');
  }

  return (
    <div>
      <div className='dropcontrolcentre'>
        <div className='l'>
          <a
            onMouseEnter={() => setShowIconW(true)}
            onMouseLeave={() => setShowIconW(false)}
          >
            <p
              className='wf'
              style={{ background: bw }}
              onClick={click}
            >
              <i className='fa fa-wifi'></i>
            </p>
            Wi-Fi
          </a>
          {showIconW && (
            <img src={airdrop} alt='Airdrop' className='icon' />
          )}
        </div>
        <div className='l'>
          <a
            onMouseEnter={() => setShowIconB(true)}
            onMouseLeave={() => setShowIconB(false)}
          >
            <p
              className='wf'
              style={{ background: bb }}
              onClick={click2}
            >
              <i className='fa fa-bluetooth'></i>
            </p>
            Bluetooth
          </a>
          {showIconB && (
            <img src={bluetooth} alt='Bluetooth' className='icon' />
          )}
        </div>
        <div className='l'>
          <a
            onMouseEnter={() => setShowIconA(true)}
            onMouseLeave={() => setShowIconA(false)}
          >
            <p
              className='wf'
              style={{ background: ba }}
              onClick={click3}
            >
              <i className='fa fa-airdrop'></i>
            </p>
            Airdrop
          </a>
          {showIconA && (
            <img src={stage} alt='Stage' className='icon' />
          )}
        </div>
        <div className='l'>
          <a
            onMouseEnter={() => setShowIconF(true)}
            onMouseLeave={() => setShowIconF(false)}
          >
            <p
              className='wf'
              style={{ background: bf }}
              onClick={click4}
            >
              <i className='fa fa-moon-o'></i>
            </p>
            Night Shift
          </a>
          {showIconF && (
            <img src={focus} alt='Focus' className='icon' />
          )}
        </div>
      </div>

      <div className='bright'>
        <img src={screen} alt='Screen' />
        <input
          type='range'
          min='0'
          max='100'
          defaultValue='50'
          className='slider'
          ref={brightRef}
          onChange={handleBrightnessChange}
        />
      </div>

      <div className='volume'>
        <input
          type='range'
          min='0'
          max='100'
          defaultValue='50'
          className='slider'
          ref={volRef}
          onChange={handleVolumeChange}
        />
      </div>
    </div>
  );
}
